import { BadgeDefaultProps } from './props';
import computed from '../mixins/computed';
Component({
    mixins: [computed],
    props: BadgeDefaultProps,
    methods: {
        computed: function (props) {
            var text = props.text;
            var overCount = false;
            if (typeof text === 'number') {
                if (text >= 100) {
                    overCount = true;
                }
            }
            return { overCount: overCount };
        },
    },
});
